sys_variable_value.value:
(function execute(inputs, outputs) {
var parser = new sn_impex.GlideExcelParser();

var attachment = new GlideSysAttachment();

// Use the attachment sys_id of an Excel file
var attachmentStream = attachment.getContentStream(inputs.fileid);

  var headers;
  var row = [];
  var temp_row;
  var clean_data = [];
  var row_num = 0;
  var gr = new GlideRecord("x_snc_establishm_0_establishment_request");

// Set the source to be parsed
parser.setSource(attachmentStream);

// Get the worksheet names to be parsed in the Excel document
var list_sheet_name = parser.getSheetNames();

gs.info(" Sheet Names " + list_sheet_name.join(", "));

// Iterate over each worksheet in the Excel workbook
for (var i = 0; i < list_sheet_name.length; i++) {
    //gs.info("**************************************************************************************");
   // gs.info("Sheet name:    " + list_sheet_name[i]);

// Set the worksheet name to be parsed
    parser.setSheetName(list_sheet_name[i]);

// Parse each worksheet set using setSheetName()
    if (parser.parse()) {
        //retrieve the column headers
        headers = parser.getColumnHeaders();

        // Iterate over each row in the worksheet
        while (parser.next()) {
            temp_row = parser.getRow();
			row[row_num] = JSON.stringify(temp_row); 
			gs.info(row[row_num]);

            gr.initialize();

            var temp_row2 = temp_row[headers[0]];
            for (j=1; j<headers.length; j++) {
              temp_row2 = temp_row2 + ':::' + temp_row[headers[j]];
              gr.setValue("role_id", "1000");
              gr.setValue("date_to_be_created", "2022-03-01");

            }
          clean_data[i] = temp_row2;
          gr.insert();
		  row_num = row_num + 1;
        }
    } else
        gs.info(parser.getErrorMessage());
}



  outputs.headers = headers;
  outputs.column_count = headers.length;
  outputs.row_count = row.length;
  outputs.excel_data = row;
  outputs.clean_data = clean_data;
  parser.close();

})(inputs, outputs);

